DROP PROCEDURE IF EXISTS `updateOrderByOrderId`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateOrderByOrderId`(IN `updateTime` datetime,IN `userId` varchar(125),IN `version` int(2),IN `oId` varchar(125) )
BEGIN
update `order` as o set o.updateTime = updateTime , o.userId =
		userId , o.version = (o.version+1) where o.oId = oId and o.version = version;
END
;;
