DROP PROCEDURE IF EXISTS `updateOrderPayByOrderId`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateOrderPayByOrderId`(IN `isPay` INT(1),IN `payState` INT(1),IN `payToken` VARCHAR(125),IN `version` INT(2),IN `oId` VARCHAR(125))
BEGIN
  update `order` as o set o.isPay = isPay , o.payState  = payState , o.payToken = payToken , o.version = o.version+1 
  where o.oId = oId and o.version = version;
END
;;
